import React from 'react'
import view_thumbnail from '../assets/view_thumbnail.svg'
import view_uneven from '../assets/view_uneven.svg'
import view_detailed from '../assets/view_detailed.svg'

export default function ViewMode(props) {
    return (
        <div style={{ display: "-webkit-inline-flex", width: "200px" }}>
            <img src={view_thumbnail} alt="view_thumbnail" id='view_thumbnail' />
            <img src={view_uneven} alt="view_uneven" id='view_uneven' />
            <img src={view_detailed} alt="view_detailed" id='view_detailed' />
        </div>
    )
}
